通常のエンジンの数十倍のオン・オフはエンジンの潤滑不良、摩擦磨耗の発生原因となり、エンジン寿命の短化、騒音の発生、燃費の低下をもたらします。エンジンの開発設計段階でもこの点は検討され、各パーツの軽量化、材料の選択に加えエンジンピストンの樹脂コーティングも採用されています。 <br><br>マイクロロンがもたらすベストコンディションの持続は愛車との末永いお付き合いを実現し、まさしく 「地球に優しい」車の「地球に優しい」乗り方を実現します。<br><br> <br><br>ユニバーサル  <br><br>　車検対応品<br><br>ケミカル系/添加剤<tr><td colspan="2">
