エンジン内部のすべての摺動部分の摩擦を効果的かつ長期間に渡って減少させることを目的に調剤された金属表面処理剤です。マイクロロンは、金属表面にマイクロロン樹脂の極めて薄い膜を形成し、摩擦と金属の磨耗を軽減させます。実際にマイクロロン処理の行われたエンジンのエンジンオイル中には摩擦金属粒子の減少が確認され、カーボンの付着やスラッジの形成を抑えています。また一度の処理で長期間効果が持続することも特長の一つで、オイル交換のたびにマイクロロンを入れる必要はありません。 <br><br>※マイクロロンがオートバイのクラッチに悪影響を与えないことはモーターサイクルドクター SUDAの保証付きです。※マイクロロンは、オイルやグリースの性質を変化させてその効果をあげるようデザインされているオイル添加剤ではありません。マイクロロンはエンジンオイルや燃料中に混入されて各金属表面へ運ばれますが、決してそれらの性質を変えることはありません。<br><br>必要量の目安（4サイクルエンジン）：排気量1300cc迄 8oz　/　2800cc迄 16oz　/　6000cc迄  32oz　　※但し、特例としてポルシェ911系は32ozです <br><br>ユニバーサル  <br><br>　車検対応品<br><br>ケミカル系/添加剤<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


