マイクロロンを改良した上級モデルです。元々航空機エンジン用に開発され、速効性があり、注入後約2時間走行程度で処理の90％以上が完了しますので、注入後の慣らし運転の時間が大幅に短縮されます。防錆・防蝕効果も大幅に増強しましたので使用頻度の少なくなりがちなエンジンに最適です。貴重なビンテージカーやポルシェ、フェラーリ、AMG、ALPINAなど特殊な利用方法になりがちな車にお勧めします。 <br><br>従来のマイクロロンに比してもより耐熱性が強められていますので、熱的な負荷の大きい高性能エンジンには特にお勧めします。<br><br>必要量の目安（4サイクルエンジン）：排気量1300cc迄 8oz　/　2800cc迄 16oz　/　6000cc迄  32oz　　※但し、特例としてポルシェ911系は32ozです <br><br>ユニバーサル  <br><br>　車検対応品<br><br>ケミカル系/添加剤<tr><td colspan="2">
